{"output":""""PyInstaller runtime hook to wire edition resources and ffmpeg paths."""

from __future__ import annotations

import os
import sys
from pathlib import Path


def _resources_root() -> Path:
    if getattr(sys, "frozen", False):
        macos_dir = Path(sys._MEIPASS)  # type: ignore[attr-defined]
        contents_dir = macos_dir.parent
        return contents_dir / "Resources" / "edition" / "resources"

    project_root = Path(__file__).resolve().parents[3]
    return project_root / "edition" / "resources"


def _ensure_env(name: str, value: Path) -> None:
    if name in os.environ:
        return
    os.environ[name] = str(value)


def _set_binary_env(resources_dir: Path) -> None:
    if "FFMPEG_BINARY" in os.environ:
        return

    candidate = resources_dir / "bin"
    for name in ("ffmpeg", "ffmpeg.exe"):
        binary = candidate / name
        if binary.exists():
            os.environ["FFMPEG_BINARY"] = str(binary)
            break


def _set_font_env(resources_dir: Path) -> None:
    if "GEMENG_TRIAL_WATERMARK_FONT" in os.environ:
        return

    fonts_dir = resources_dir / "fonts"
    preferred = (
        "SourceHanSansCN-Regular.otf",
        "SourceHanSans-Regular.otf",
        "NotoSansCJK-Regular.ttc",
        "NotoSansSC-Regular.otf",
    )

    for name in preferred:
        candidate = fonts_dir / name
        if candidate.exists():
            os.environ["GEMENG_TRIAL_WATERMARK_FONT"] = str(candidate)
            break


def set_trial_runtime_env() -> None:
    resources_dir = _resources_root()
    if resources_dir.exists():
        _ensure_env("GEMENG_TRIAL_RESOURCES", resources_dir)
        _set_binary_env(resources_dir)
        _set_font_env(resources_dir)


set_trial_runtime_env()
